what is causing mongodb shell to not show all records when I use .find()?<p>I'm running mongodb version 3.6.2 on osx and have been experimenting with mongodb operations such as insert, query, delete via node.js (using the official mongodb driver for node.js).</p>

<p>I also am running a front-end client application for mongodb (Robo3T - version 1.2.1) as I learn more about mongo, how it works and stores data.</p>

<p>I'm able to perform operations such as insert (one and many records), delete based on a query filter, list ALL records, etc.  But my problem comes when I go to the shell and try to run the following command:</p>

<pre><code>db.getCollection('videos').find({})
</code></pre>

<p>No records are returned and no errors.  Interesting thing is, in Robo3T, when I double click the collection, that same console command is shown (and all records are displayed, as expected).</p>

<p>And from node.js, when I run the following command, I DO get all the records listed:</p>

<pre><code>MongoClient.connect(url, function(err, db) {
  if (err) throw err;
  var dbo = db.db("collection_archivedvideo");
    dbo.collection("videos").find({}).toArray(function(err, result) {
    if (err) throw err;
    console.log(result);
    console.log(result.length)
    db.close();
  });
});
</code></pre>

<p>What am I doing wrong in the mongodb shell when I try to list all records?  I don't think it should matter, but the collection has about 1,500 records and were imported as a bulk / many import from a local JSON dataset/file.  </p>

