MongoError: must have $meta projection for all $meta sort keys using Mongo DB Native NodeJS Driver<p>Running the following text search directly on MongoDB results in no issues:</p>

<pre><code>db.getCollection('schools').find({
  $text:
    {
      $search: 'some query string',
      $caseSensitive: false,
      $diacriticSensitive: true
    }
}, {score: {$meta: "textScore"}}).sort({score:{$meta:"textScore"}})
</code></pre>

<p>However when trying to run the same query using the <a href="https://www.npmjs.com/package/mongodb" rel="noreferrer">native NodeJS driver</a>:</p>

<pre><code>function getSchools(filter) {
  return new Promise(function (resolve, reject) {

    MongoClient.connect('mongodb://localhost:60001', function(err, client) {
      const collection = client.db('schools').collection('schools');

      collection.find({
        $text:
          {
            $search: filter,
            $caseSensitive: false,
            $diacriticSensitive: true
          }
        }, {score: {$meta: "textScore"}}).sort({score:{$meta:"textScore"}}).toArray(function(err, docs) {
        if (err) return reject(err);

        resolve(docs);
      });
    });
  });
}
</code></pre>

<p>I'm getting the following error:</p>

<pre><code>MongoError: must have $meta projection for all $meta sort keys
</code></pre>

<p>What am I doing wrong here?</p>

